import React, { useEffect } from "react";
import axios from "axios";

const options = {
  method: "GET",
  url: "https://api-football-v1.p.rapidapi.com/v3/players/topscorers",
  params: {
    league: "39",
    season: "2020",
  },
};

const Test = () => {
  useEffect(() => {
    axios
      .request(options)
      .then((response) => {
        console.log(response.data);
      })
      .catch((error) => {
        console.log(error);
      }, []);
    return <div></div>;
  });
};
export default Test;
